import axios from "axios";
import React, { useEffect } from "react";


export default function Img(){
    useEffect(()=>{
        axios.get('http://localhost:5555/booking')
          .then((res)=>{console.log(res.data.guestCount)})
          .catch((err)=>console.log(err))
      }) 
}
